dynamicConfigDescriptions.type:
{
    parser: (meta: unknown) => PolymorphicMeta
    generator: (meta: unknown) => PolymorphicMeta
}

categoryMeta.parser:
__FUNCTION__:(input) => {
  if (!IsCategoryMeta(input)) {
    throw new TypeError(
      `content meta error: invalid input, check ${prettyPrint(input)}`
    );
  }
  const { title, description, postCollection } = input;
  return {
    title,
    description,
    postCollection
  };
}
